import React, { Component } from 'react';
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

class Header extends Component {
    render() { 
        return (
            <header>
                <div className="navbar navbar-dark bg-dark shadow-sm">
                    <div className="container">
                     <span className="navbar-brand d-flex align-items-center">
                        <strong>ShootstaTube</strong>
                    </span>
                    <button className="navbar-toggler" type="button" data-toggle="modal" data-target="#uploadModal" 
                    aria-controls="navbarHeader" aria-expanded="false">
                        <svg xmlns="http://www.w3.org/2000/svg" width="36" height="36" fill="currentColor" className="bi bi-plus-circle" viewBox="0 0 16 16">
                            <path d="M8 15A7 7 0 1 1 8 1a7 7 0 0 1 0 14zm0 1A8 8 0 1 0 8 0a8 8 0 0 0 0 16z"/>
